import React from 'react';
import { BrowserRouter, Route } from 'react-router-dom';

const PageOne = () => {
  return (
    <div>PageOne</div>
  )
}

const PageTwo = () => {
  return (
    <div>
      <div>PageTwo</div>
      <button>click me</button>
    </div>
  )
}

export const App = () => {
  return (
    <div>
      <BrowserRouter>
        <Route path="/" exact component={PageOne} />
        <Route path="/pageTwo" exact component={PageTwo} />
      </BrowserRouter>
    </div>
  )
}
